/**
 * 天体位置計算基底クラス
 * @param {Date} target_date 指定日時
 * @param {number} time_diff 世界標準時からの時差
 */
let CoastGuardMethod = function (target_date, time_diff) {
    // date
    // 世界標準時に直す
    this.target_date = new Date(target_date.getFullYear(), target_date.getMonth(), target_date.getDate(), target_date.getHours() - time_diff);
    this.year = this.target_date.getFullYear();
    this.month = this.target_date.getMonth() + 1;
    this.date = this.target_date.getDate();
    this.hour = this.target_date.getHours();
    this.min = this.target_date.getMinutes();
    this.time_diff = time_diff;
    
    // Params
    this.P = this.month - 1;
    this.Q = Math.floor((this.month + 7) / 10);
    this.Y = Math.floor((this.year / 4) - Math.floor(this.year / 4) + 0.77);
    this.S = Math.floor(this.P * 0.55 - 0.33)

    // 通日T
    this.T = 30 * this.P + this.Q * (this.S - this.Y) + this.P * (1 - this.Q) + this.date;

    // 観測時刻の世界時UTを日の端数Fで表す
    this.F = this.hour / 24 + this.min / 1440;

    // 地球時 - 世界時 dt
    this.dt = this.dtList[this.year];

    // 計算用の時刻引数t
    this.t = this.T + this.F + this.dt / 86400;

    // calc params
    this.a = 0;
    this.b = 0;

    // conts
    this.a1 = 0;
    this.a2 = 0;
    this.a3 = 0;
    this.b1 = 0;
    this.b2 = 0;
    this.b3 = 0;
}

/**
 * 指定した天体の位置を取得する
 * @param {Planet} planet 位置を計算する惑星
 * @returns {number} 黄経
 */
CoastGuardMethod.prototype.getPosition = function (planet) {
    let calcParams = this.getParams(planet);
    if (calcParams === undefined || calcParams === null) {
        return null;
    }
    else {
        let theta = Math.acos((2 * this.t - (this.a + this.b)) / (this.b - this.a)) % Math.PI;
        let RA = 0;
        let DEC = 0;
        for (let i = 0; i < calcParams.RA.length; i++) {
            let costheta = Math.cos(theta * i);
            RA += calcParams.RA[i] * costheta;
            DEC += calcParams.DEC[i] * costheta;
        }

        RA = RA * 15 * CalcAstroBase.DEG2RAD;
        DEC *= CalcAstroBase.DEG2RAD;

        // 赤経・赤緯から黄経を計算
        let e = CalcAstroBase.geteclipticInclinationAngle(CalcAstroBase.getLocalTime(this.target_date, this.time_diff)) * CalcAstroBase.DEG2RAD;
        let lambda = Math.atan2((Math.sin(DEC) * Math.sin(e) + Math.cos(DEC) * Math.sin(RA) * Math.cos(e)), (Math.cos(DEC) * Math.cos(RA)));
        if (lambda < 0) lambda += Math.PI * 2
        return lambda * CalcAstroBase.RAD2DEG;
    }
}

/**
 * 計算式の定数項を取得
 */
CoastGuardMethod.prototype.getParams = function (planet) {
    let t = this.t;
    let year = this.target_date.getFullYear()
    let paramList = this.params[planet.value][year];
    if (!paramList) {
        return paramList;
    }

    let param = {};
    for (var i = 0; i < paramList.length; i++) {
        let tmp = paramList[i];
        let a = tmp.a;
        let b = tmp.b;
        if (a <= t && t <= b) {
            this.a = a;
            this.b = b;
            param = tmp;
        }
    }
    return param;
}

